                veh.Cor1.red = r;
                veh.Cor1.green = g;
                veh.Cor1.blue = b;
                API.setVehicleCustomPrimaryColor(veh.Veh, veh.Cor1.red, veh.Cor1.green, veh.Cor1.blue);
                strUpdate = string.Format("UPDATE veiculos SET Cor1R = {1}, Cor1G = {2}, Cor1B = {3} WHERE ID = {0}", veh.ID, r, g, b);
